import React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import { useNavigate } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';
import classes from '../Login.module.css';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import InputAdornment from '@mui/material/InputAdornment';
import DatePicker from '../DatePicker';

const TaskForm = props => {
    const navigate = useNavigate()

    const goBackHandler = () => {
        navigate("/Home")
    }

    return (
        <Container align="center">
            <Card variant="outlined" sx={{ maxWidth: 500, maxHeight: 8000, borderRadius: 5, borderColor: 'primary.main', paddingTop: 1, m: 1 }} margin="10px">
                <CardActions>
                    <IconButton sx={{ marginLeft: 1, }} onClick={goBackHandler}>
                        <ChevronLeftIcon />
                    </IconButton>
                </CardActions>
                <CardContent>
                    <Typography variant="h4" component='div' fontSize='26px' className={classes.registration}>Agency Profile</Typography>
                    <Box
                        component="form"
                        sx={{
                            marginTop: 5,
                            marginLeft: 0,
                            '& .MuiTextField-root': { m: 1, width: '40ch', size: 'small' },
                        }}
                        noValidate
                        autoComplete="off"  >
                        <div>
                            <TextField
                                required
                                multiline
                                size='medium'
                                id="username"
                                label="UserName"
                                placeholder="xyz_abc123"
                            />
                            <TextField
                                multiline
                                size='medium'
                                id="roll-id-agency"
                                label="Roll"
                                defaultValue="Agency"
                            />
                            <TextField
                                required
                                multiline
                                size='medium'
                                id="description"
                                label="description-task"
                                placeholder="xyzbfhfkabc"
                            />
                            <TextField
                                id="date-picker-task"
                                label="Date"
                                placeholder='Set Date'
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <DatePicker />
                                        </InputAdornment>
                                    ),
                                }}
                                variant="outlined">
                            </TextField>


                            <div className={classes.button}>
                                <Button
                                    variant="contained"
                                    onClick={props.onClick}
                                    sx={{
                                        marginTop: 0.5,
                                        marginRight: -34,
                                    }}>
                                    Submit</Button>
                            </div>
                        </div>
                    </Box>
                </CardContent>
            </Card>
        </Container>
    );

};
export default TaskForm;
